import React ,{ useEffect, useState} from "react";
import axios from 'axios'

const DroneData = () => {
    fetch('https://assignments.reaktor.com/birdnest/drones').then(function(response) {
        return response.json();
      }).then(function(data) {
        console.log(data);
      }).catch(function() {
        console.log("Booo");
      });
};

export default DroneData;
